function FetchData() {

    const handleFetch = () => {
        fetch('http://localhost:4000/stories')           //api for the get request
        .then(response => response.json())
        .then(data => console.log(data)); 
    }


  return (
    <div>
        <button onClick={handleFetch}>Fetch Story</button>
    </div>
  )
}

